import logo from './ashesi_logo.jpeg';
import {
  createTheme,
  ThemeProvider,
  makeStyles,
} from "@material-ui/core/styles";
import { Typography } from "@material-ui/core";
import './App.css';

function App() {
  return (
    <div className="App">

      <img src={logo} className="App-logo" alt="logo" />

    </div>
  );
}

export default App;
